import React from 'react'

function Add() {
    const handleAdd = (e) => {
        e.preventDefault()
    }
    return (
        <div className="small-container">
            <form onSubmit={handleAdd}>
                <h1>Add Employee</h1>
                <label htmlFor="firstName">First Name</label>
            </form>
        </div>
    )
}

export default Add
